        public static bool ValidSeed(int id,bool curate = false)
        {
            // Fairy
            bool fairy = false;
            int fairyDay = 0;
            for (int day = 58; day < 65; day++) {
                fairy = NightEvents.GetEvent(id, day) == NightEvents.Event.Fairy;
                if (fairy)
                {
                    fairyDay = day;
                    break;
                }
            }

            if (!fairy)
            {
                return false;
            }

            // CalicoJack
            int wins = 0;
            int timesPlayed = -1;
            while (wins < 20)
            {
                timesPlayed++;
                if (CalicoJack.CalculateHand(timesPlayed, 28 * 2 + 7, id) == -1)
                {
                    wins = 0;
                    continue;
                }

                wins += 1;
            }
            if (timesPlayed > 120)
            {
                return false;
            }

            // Rare Seeds
            HashSet<int> usefulDays = new();
            int rareSeed5s = 0;
            List<int> rareSeedCartDays = new() { 42, 47, 49, 54, 56 };

            List<string> rareSeedInfo = new();
            foreach (var day in  rareSeedCartDays)
            {
                CartItem item = TravelingCart.GetStock(id, day).Find(s => s.Id == "347");
                if (item.Quantity == 5)
                {
                    rareSeed5s +=1;
                    rareSeedInfo.Add($"{day}: {item.Cost}");
                    usefulDays.Add(day);
                }
            }

            if (rareSeed5s < 2)
            {
                return false;
            }

            // Other items
            List<int> casinoCartDays = new() { 33, 35, 40, 42, 47, 49, 54, 56, 68, 70, 75, 77, 82, 84 };

            int beets = 0;
            bool solarEssence = false;

            int neededCost = 0;

            List<string> cartInfo = new();
            foreach (var day in casinoCartDays)
            {
                var stock = TravelingCart.GetStock(id, day);

                string info = "";

                foreach(var item in stock)
                {
                    if (curate)
                    {
                        //Console.WriteLine(item.ToString());
                    }
                    switch (item.Id)
                    {
                        case "284":
                            //if (item.Quantity == 5)
                            //{
                                beets += item.Quantity;
                                info += $" Beets({item.Cost* item.Quantity}),";
                                neededCost += item.Cost * 5;
                                usefulDays.Add(day);
                            //}
                            break;

                        case "394":
                            info += $" Rainbow Shell({item.Cost}),";
                            //usefulDays.Add(day);
                            break;

                        case "494":
                            continue;
                            if (day > 78)
                            {
                                continue;
                            }
                            info += $" Beet Seeds({item.Cost}, {item.Quantity}),";
                            beets += item.Quantity;
                            neededCost += item.Cost * item.Quantity;
                            usefulDays.Add(day);
                            break;

                        case "768":
                            solarEssence = true;
                            info += $" Solar Essence({item.Cost}),";
                            neededCost += item.Cost;
                            usefulDays.Add(day);
                            break;

                        case "787":
                            info += $" Battery Pack({item.Cost}),";
                            //usefulDays.Add(day);
                            break;
                    }
                }
                if (info != "")
                {
                    info = day.ToString() + ":" + info;
                    cartInfo.Add(info);
                }
            }

            //if (usefulDays.Count > 4) { return false; }
            if (beets < 10 || !solarEssence)
            {
                return false;
            }
            if (curate)
            {
                FileStream fs = null;
                int i = 0;
                while (fs == null)
                {
                    try
                    {
                        fs = new FileStream($"PerfectionOutput{i}.txt", FileMode.Append);
                    }
                    catch
                    {
                        i++;
                    }
                }
                int count = usefulDays.Count;
                StreamWriter stream = new StreamWriter(fs);
                stream.WriteLine($"{id};Fairy:{fairyDay};{beets};{String.Join(" ", rareSeedInfo)};{String.Join(" ", cartInfo)};CalicoJack: {timesPlayed - 20};UsefulDays:{count};cost:{neededCost}");
                Console.WriteLine($"{id};Fairy:{fairyDay};{beets};{String.Join(" ", rareSeedInfo)};{String.Join(" ", cartInfo)};CalicoJack: {timesPlayed - 20};UsefulDays:{count};cost:{neededCost}");
                stream.Close();
                
            }

            return true;
        }

        // parallel search
        public static double Search(int startSeed, int endSeed, int blockSize, out List<int> validSeeds)
        {
            Stopwatch stopwatch = Stopwatch.StartNew();
            var bag = new ConcurrentBag<int>();
            var partioner = Partitioner.Create(startSeed, endSeed, blockSize);
            Parallel.ForEach(partioner, (range, loopState) =>
            {
                for (int seed = range.Item1; seed < range.Item2; seed++)
                {
                    if (seed % 2 == 0)
                    {
                        continue;
                    }
                    if (ValidSeed(seed))
                    {
                        FileStream fs = null;
                        int i = 0;
                        while (fs == null)
                        {
                            try
                            {
                                fs = new FileStream($"PerfectionNewRNG{i}.txt", FileMode.Append);
                            }
                            catch
                            {
                                i++;
                            }
                        }
                        StreamWriter stream = new StreamWriter(fs);
                        stream.Write($"{seed},");
                        Console.WriteLine(seed);
                        stream.Close();
                        bag.Add(seed);
                    }
                }
            });
            double seconds = stopwatch.Elapsed.TotalSeconds;
            Console.WriteLine($"Found: {bag.Count} sols in {seconds.ToString("F2")} s");
            validSeeds = bag.ToList();
            validSeeds.Sort();
            return seconds;
        }
    }
